'use strict';
let string_map = require('@gehtsoft/LuaxStdlib-node').string_map;
let exception = require('@gehtsoft/LuaxStdlib-node').exception;
//@@DocBrief("The base class for 'account' manager wrapper storage")
class AManagerAccountWrapperStorage {
    storage;
    constructor() {
        this.storage = new string_map();
    }
    createManagerByAccount(accountInfo) {
        throw exception.create(0, "'createManagerByAccount' method is not implemented");
    }
    getObjectByAccount(accountInfo) {
        let key, value;
        if (accountInfo == null) {
            return null;
        }
        key = accountInfo.getId();
        if (this.storage.contains(key)) {
            return this.storage.get(key);
        }
        value = this.createManagerByAccount(accountInfo);
        this.storage.set(key, value);
        return value;
    }
}
module.exports = AManagerAccountWrapperStorage
